import React from 'react'

function NameList() {
    const names = ['Bruce', 'Clark', 'Diana']
    const nameList = names.map(name => <h2>{name}</h2>)
    const nameList2 = names.map(name => names[0])

    return (
        <div>
            {
                nameList2
            }   
        </div>
    )
}

export default NameList
